import { Container, Grid } from '@mui/material';
import './App.css';

function App() {
    return (
        <Container>
            <Grid container>
                <Grid item xs={12} sm={12} md={4} lg={3} style={{backgroundColor: 'blue'}}>
                testing grid
                </Grid>
                <Grid item xs style={{backgroundColor: 'red'}}>
                testing grid 
                </Grid>
            </Grid>
        </Container>
    );
}

export default App;
